-- 일별 거래 건수 확인
SELECT 
    trading_date,
    COUNT(*) as daily_trades
FROM trading_history 
WHERE account_number = '99911122222'
GROUP BY trading_date
ORDER BY trading_date;

-- 매수/매도 건수 확인
SELECT 
    buy_sell_code,
    CASE 
        WHEN buy_sell_code = '1' THEN '매수'
        WHEN buy_sell_code = '2' THEN '매도'
    END as trade_type,
    COUNT(*) as count
FROM trading_history 
WHERE account_number = '99911122222'
GROUP BY buy_sell_code;
